import { Component } from '@angular/core';
import {AppService} from './services/app.service';
import {Platform} from '@ionic/angular';
import {WebApiService} from './services/web-api.service';
import {AuthService} from './services/auth.service';
import {LoadingService} from './services/loading.service';

@Component({
  selector: 'app-root',
  templateUrl: 'app.component.html',
  styleUrls: ['app.component.scss'],
})
export class AppComponent {
  constructor(
    private appService: AppService,
    private apiService: WebApiService,
    private authService: AuthService,
	public loadingService: LoadingService,
    private platform: Platform
  ) {
    platform.ready().then(async (data) => {
      // Получаем валидный url
      this.apiService.getValidUrl();
      this.authService.checkToken();
	  this.loadingService.loading.subscribe((loading) => console.log('loading: ', loading));

      console.log('platform ready', data);
    });
  }
}

import {Component, OnInit} from '@angular/core';
import {FormBuilder, FormGroup, Validators} from '@angular/forms';
import {AuthService} from '../../services/auth.service';

@Component({
	selector: 'app-auth',
	templateUrl: './auth.page.html',
	styleUrls: ['./auth.page.scss'],
})
export class AuthPage implements OnInit {

	form: FormGroup;

	constructor(
		private authService: AuthService
	) {
		this.form = new FormBuilder().group({
			login: [null, [Validators.required]],
			password: [null, [Validators.required]]
		});
	}

	ngOnInit() {
	}

	async onSubmit(form) {
		const authObject = {
			l: form.value.login,
			p: form.value.password
		};
		this.authService.authByLoginPass(authObject);
		// this.form.reset();
	}
}

