import {NgModule} from '@angular/core';
import {BrowserModule} from '@angular/platform-browser';
import {RouteReuseStrategy} from '@angular/router';

import {IonicModule, IonicRouteStrategy} from '@ionic/angular';

import {AppComponent} from './app.component';
import {AppRoutingModule} from './app-routing.module';
import {ServiceModule} from './services/service.module';
import {HTTP_INTERCEPTORS} from '@angular/common/http';
import {AuthInterceptor} from './interceptors/auth.interceptor';
import {ComponentsModule} from './components/components.module';

@NgModule({
	declarations: [AppComponent],
	imports: [BrowserModule, IonicModule.forRoot(), AppRoutingModule, ServiceModule, ComponentsModule],
	providers: [
		{provide: RouteReuseStrategy, useClass: IonicRouteStrategy},
		{provide: HTTP_INTERCEPTORS, useClass: AuthInterceptor, multi: true},
	],
	bootstrap: [AppComponent],
})
export class AppModule {
}

import {NgModule} from '@angular/core';
import {PreloadAllModules, RouterModule, Routes} from '@angular/router';

const routes: Routes = [
	{
		path: 'home',
		loadChildren: () => "import('./home/home.module').then(m => m.HomePageModule)"
	},
	{
		path: 'auth',
		loadChildren: () => "import('./base/tabs/tabs.module').then(m => m.TabsPageModule)",
		data: {
			header: false,
			tabs: [
				{
					tab: 'phone',
					label: 'Телефон'
				},
				{
					tab: 'login',
					label: 'Логин/Пароль'
				}
			]
		}
	},
	{
		path: 'pin',
		loadChildren: () => "import('./pages/pin/pin.module').then(m => m.PinPageModule)"
	},
	{
		path: 'dashboard',
		loadChildren: () => "import('./pages/dashboard/dashboard.module').then( m => m.DashboardPageModule)"
	},
	{
		path: '',
		redirectTo: 'auth',
		pathMatch: 'full'
	},
];

@NgModule({
	imports: [
		RouterModule.forRoot(routes, {preloadingStrategy: PreloadAllModules})
	],
	exports: [RouterModule]
})
export class AppRoutingModule {
}

